import React from 'react';
import { Link } from 'react-router-dom';
import './styles.css';

function Navigation() {
  return (
    <nav style={{ padding: '20px', backgroundColor: '#4a90e2', color: '#fff' }}>
      <ul style={{ display: 'flex', justifyContent: 'space-around', listStyle: 'none', margin: 0, padding: 0 }}>
        <li><Link to="/" style={{ color: '#fff', textDecoration: 'none' }}>Home</Link></li>
        <li><Link to="/appointment-management" style={{ color: '#fff', textDecoration: 'none' }}>Appointment Management</Link></li>
        <li><Link to="/patient-management" style={{ color: '#fff', textDecoration: 'none' }}>Patient Management</Link></li>
        <li><Link to="/staff-management" style={{ color: '#fff', textDecoration: 'none' }}>Staff Management</Link></li>
        <li><Link to="/supply-management" style={{ color: '#fff', textDecoration: 'none' }}>Supply Management</Link></li>
      </ul>
    </nav>
  );
}

export default Navigation;
